list.comment:
Added three more text files for storing tasks (completedTasks, laterTasks, weekTasks).

Refactored TaskItem, TaskDatabase classes: introduced a default time period which is used for defining a default file for writing tasks into.

Added new commands to CommandWord and handling of some commands in consoleView.mainLoop().

New functionality: 
- define a default file for writing using a default time period;
- show tasks for different time periods (week, later, completed);

task.summary:
Added classes: TimePeriod (storage for time periods), CommandWord (enum for command words), CommandMap (store command words in a hashmap), TaskDatabase (write and read tasks from a text file), ConsoleView (for working in the console).

New functionality: 
- possibility to work in the console; 
- use command words to operate the app;
- create new tasks and write them into a file;
- read (print) the tasks from the file.

